import React, { Component } from 'react';

import Card from './Card';

export default class List extends Component {
    render() {
        let cards = this.props.listOfCards.map((card, cardIndex) => {
            return (
                <Card 
                    id={card.id} 
                    cardIndex={cardIndex}
                    cardTitle={card.cardTitle}
                    description={card.description}
                    status={card.status}
                    level={card.level} />
            )
        })
        return(
            <div>
                {this.props.title}
                {cards}
            </div>
        )
    }
}
